create database if not exists trab3;

use trab3;

drop table if exists DadosDS;

CREATE TABLE `DadosDS` (
  `enrollee_id` int(11) NOT NULL,
  `city` varchar(150) DEFAULT NULL,
  `city_development_index` varchar(150) DEFAULT NULL,
  `gender` varchar(150) DEFAULT NULL,
  `relevent_experience` varchar(150) DEFAULT NULL,
  `enrolled_university` varchar(150) DEFAULT NULL,
  `education_level` varchar(150) DEFAULT NULL,
  `major_discipline` varchar(150) DEFAULT NULL,
  `experience` varchar(150) DEFAULT NULL,
  `company_size` varchar(150) DEFAULT NULL,
  `company_type` varchar(150) DEFAULT NULL,
  `last_new_job` varchar(150) DEFAULT NULL,
  `training_hours` varchar(150) DEFAULT NULL, 
  PRIMARY KEY (`enrollee_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=latin1;



